import React from 'react';
import ReactDOM from 'react-dom/client';
// import './index.css';
import App from './App';
import './i18n';
// import reportWebVitals from './reportWebVitals';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <Router>
      <Routes>
        <Route path="/" element={<App />}/>
      </Routes>
    </Router>
  </React.StrictMode>
);

